import Layout from '../Components/Layout/Layout'

class Index extends Component{
	render(){
		return(
			<Layout>
				<img src="/static/pp.jpg" alt="..." style= {{}} class="d-block rounded-circle img-thumbnail"/>
			</Layout>
		)
	}
}

export default Index;
